window.onload = function () {
    if ($("div").is(".blog-inner")) {
        var $blog__grid = $('.blog-inner__grid');
        $blog__grid.masonry({
            itemSelector: '.grid-item',
            gutter: '.gutter-sizer',
            columnWidth: '.grid-sizer',
            percentPosition: true
        });
        $('input[type="search"]').focus(function () {
            $('.blog-inner__tabs ul li:not(:first-child)').css("display", "none");
            $('.blog-inner__tabs ul li:first-child').css("margin-right", "0");
            $('.blog-inner__tabs ul li:first-child').css("width", "100%");
            setTimeout(function () {
                $('.blog-inner__tabs ul li:first-child span').fadeIn();
            }, 500);
        });
        $('input[type="search"]').focusout(function () {
            $('.blog-inner__tabs ul li:first-child span').fadeOut();
            setTimeout(function () {
                $('.blog-inner__tabs ul li:not(:first-child)').css("display", "flex");
                $('.blog-inner__tabs ul li:first-child').css("width", "auto");
            }, 500);
            if (window.innerWidth > 1023) {
                $('.blog-inner__tabs ul li:first-child').css("margin-right", "2.75rem");
            }
        });
        $('.blog-inner__tabs ul li:first-child span').click(function () {
            setTimeout(function () {
                $('.blog-inner__tabs ul li:not(:first-child)').css("display", "flex");
                $('.blog-inner__tabs ul li:first-child').css("width", "auto");
            }, 500);
            if (window.innerWidth > 1023) {
                $('.blog-inner__tabs ul li:first-child').css("margin-right", "2.75rem");
            }
        });
    }
};
"use strict";

if ($("div").is(".check-list")) {
    var checkedInput = function checkedInput() {
        var array = [];

        for (var i = 0; i < arrayLength; i++) {
            //i=0 , i< ,  
            if (arrayAllInput[i].checked === true) //       
                {
                    array.push(arrayAllInput[i]); //    
                }
        }
        currentMark.innerHTML = array.length;
        if (array.length < 10) {
            for (var i = 0; i < results.length; i++) {
                results[i].classList.remove('active');
            }
            results[0].classList.add('active');
            $(".check-list__button-wrap").fadeIn();
        }
        if (array.length <= 22 && array.length >= 11) {
            for (var i = 0; i < results.length; i++) {
                results[i].classList.remove('active');
            }
            results[1].classList.add('active');
            $(".check-list__button-wrap").fadeIn();
        }
        if (array.length <= 34 && array.length >= 23) {
            for (var i = 0; i < results.length; i++) {
                results[i].classList.remove('active');
            }
            results[2].classList.add('active');
            $(".check-list__button-wrap").fadeIn();
        }
        if (array.length <= 36 && array.length >= 35) {
            for (var i = 0; i < results.length; i++) {
                results[i].classList.remove('active');
            }
            results[3].classList.add('active');
            $(".check-list__button-wrap").fadeOut();
        }
    };

    if (window.innerWidth > 820) {
        var $checklist_grid = $('.check-list__content-wrap');
        $checklist_grid.masonry({
            itemSelector: '.check-list__content-block',
            gutter: '.gutter-sizer__checklist',
            columnWidth: '.grid-sizer__checklist',
            percentPosition: true
        });
    }

    document.addEventListener('click', checkedInput);

    var resultblock = document.querySelector('.check-list__result-wrap');
    var results = resultblock.getElementsByTagName('p');
    var inputs_wrap = document.querySelector('.check-list__content-wrap');
    var currentMark = document.getElementById('currentMark');
    var allMarks = document.getElementById('allMarks');

    var arrayAllInput = inputs_wrap.getElementsByTagName('input'); //   input
    var arrayLength = arrayAllInput.length; //   
    allMarks.innerHTML = arrayLength;

    $('.check-list__content-block ul li div span').click(function () {
        $(this).parent().parent().find(".check-description").slideToggle();
        $(this).parent().find("i").toggleClass("active");
    });
}
